Review.create!([
  {user_id: 21, property_id: 14351, body: "The space is not too bad for the prices. It's missing a few things like a dishwasher and sink disposal, but you can live without them. The inside isn't too out of date and nothing major is broken. The worst part is the neighborhood. If you're afraid to walk down an alley at night, this is not the place for you. ", title: "Fair Apartment, Shady Neighborhood", property_rating: 3.0, landlord_rating: 4.0, landlord_comments: "I haven't had any problems with my landlord, but I do wish they offered online bill pay. It's a pain to drop a check off each month across town. ", duration: 6, anonymous_at: nil, current_tenant_at: "2016-12-03 21:49:38", approved_at: "2016-12-03 21:57:11"},
  {user_id: 19, property_id: 12791, body: "This property is fantastic. It has beautiful hardwood floors and a vaulted ceiling in the living room. The master suite is enormous and comes with a great walk in closet and on suite bathroom. The granite countertops are gorgeous and the appliances all work as expected. The only complaint I can make is that the stove is electric instead of gas which is only a personal preference.", title: "Beautiful Home in a Great Neighborhood", property_rating: 5.0, landlord_rating: 4.0, landlord_comments: "As long as you don't need attention from the landlord very often, this landlord is fantastic! Don't get me wrong, she is attentive and things get done when they need to be, but she doesn't stop by or check in very often and as long as your rent it paid she pretty much leaves you be!", duration: 24, anonymous_at: nil, current_tenant_at: "2017-01-21 02:25:46", approved_at: "2017-01-21 02:35:55"},
  {user_id: 19, property_id: 11682, body: "The west end property is beautiful inside and out. The porch, the front door, and all of the original woodwork speak to a time where craftsmanship was everything, but the new appliances and amenities are excellent. The house feels clean and new despite being quite old.  The yard is nice and the fact that we were able to have a dog was incredible.  I highly recommend 115 West End.", title: "A Great Old Home with Brand New Features", property_rating: 4.0, landlord_rating: 5.0, landlord_comments: "Bob Houchins is one of the most upstanding landlords in Cape Girardeau. He fixes problems almost always the same day they are found and is really fair to student renters. He is friendly and I think really cares about all of his tenants. He is clear in his expectations and if you break his rules you will lose your deposit but if you follow them he bends over backwards to work with you.", duration: 12, anonymous_at: nil, current_tenant_at: nil, approved_at: "2017-01-21 03:46:28"},
  {user_id: 22, property_id: 13440, body: "The rivercrest properties are a great little community to live. The back wall of 17 Rivercrest is all windows and has an amazing view of the river and rolling hills behind it. Some aspects of it are dated (partially paneled walls, older appliances) but otherwise it is a great property.", title: "Great place to live", property_rating: 4.0, landlord_rating: 5.0, landlord_comments: "Phil is a great landlord, nice guy and highly respectful of his tenants. He has been willing to work with me in a couple of situations  where a lot of landlords would leave their tenants high and dry. ", duration: 24, anonymous_at: "2017-01-21 03:50:32", current_tenant_at: "2017-01-21 03:50:32", approved_at: "2017-01-21 03:51:16"}
])
